import 'package:freezed_annotation/freezed_annotation.dart';part 'shops_location.freezed.dart';part 'shops_location.g.dart';@freezedclass ShopsMapModel with _$ShopsMapModel {  @JsonSerializable(explicitToJson: true, fieldRename: FieldRename.snake)  const factory ShopsMapModel(    bool? success,    String? message,    int? code,    MapData? data,  ) = _ShopsMapModel;  factory ShopsMapModel.fromJson(Map<String, dynamic> json) =>      _$ShopsMapModelFromJson(json);}@freezedclass MapData with _$MapData {  @JsonSerializable(explicitToJson: true, fieldRename: FieldRename.snake)  const factory MapData(List<DataLoc>? data) = _MapData;  factory MapData.fromJson(Map<String, dynamic> json) =>      _$MapDataFromJson(json);}@freezedclass DataLoc with _$DataLoc {  @JsonSerializable(explicitToJson: true, fieldRename: FieldRename.snake)  const factory DataLoc(    int? id,    String? name,    List<OpenedStores>? openedStores,    List<NotOpenedStores>? notOpenedStores,  ) = _DataLoc;  factory DataLoc.fromJson(Map<String, dynamic> json) =>      _$DataLocFromJson(json);}@freezedclass OpenedStores with _$OpenedStores {  @JsonSerializable(explicitToJson: true, fieldRename: FieldRename.snake)  const factory OpenedStores(    int? id,    String? name,    String? address,    String? description,    String? long,    String? lat,    String? phone,    String? workTime,    List<dynamic>? images,  ) = _OpenedStores;  factory OpenedStores.fromJson(Map<String, dynamic> json) =>      _$OpenedStoresFromJson(json);}@freezedclass NotOpenedStores with _$NotOpenedStores {  const factory NotOpenedStores(    int? id,    String? name,    String? address,    String? description,    String? long,    String? lat,    String? phone,    String? workTime,    List<dynamic>? images,  ) = _NotOpenedStores;  factory NotOpenedStores.fromJson(Map<String, dynamic> json) =>      _$NotOpenedStoresFromJson(json);}